import React from "react";
import Pic from "./Pic";
import Header from "./Header";
import Bio from "./Bio";
import Footer from "./Footer";

export default function Profile() {
    return (
        <div className="card-wrap">
            <main className="card">
                <Pic />
                <Header />
                <Bio />
                <Footer />
            </main>
        </div>
    );
}
